import React, { Component } from 'react';
import './index.scss';
const bgc = require('../../images/bgc.jpg')

class index extends Component {
  render() {
    return (
      <div className="content">
        <img src={bgc} alt=""style={{width:'100%',height:'100%'}}  />
        <div className="ha">hah</div>
        <video id="my-video" controls preload="auto" width="640" height="264">
            <source src={'https://vd2.bdstatic.com/mda-jb1y28tijunvff2e/sc/mda-jb1y28tijunvff2e.mp4'} type='video/mp4' />
        </video>
      </div>
    );
  }
}

export default index;
